text:
Duas constatações: 
1. O problema do Santos era o Odair (aliás, Odair será o problema de qualquer time que o contratar);
2. O Santos vai querer a volta de John para o gol. 😉

 @butzzz  kkkkkkkkkk

Apareceu dois Santistas aqui. Até que tá bacana a quantidade de respostas proporcionalmente ao que se encontra de torcedores.

Boa semana!

 @rafaelxavierdasilva1099  Com todo respeito, mas só o torcedor do Santos vai ignorar a aberração que aconteceu nesse jogo de hoje. É quase unanimidade a opinião de todos que estão acompanhando o campeonato.
Com toda a falcatrua que agente vê no futebol, com atletas de vários clubes confessando crimes envolvendo apostas, não duvidar do que aconteceu hoje isso sim é ser cego. É possível sim agt suspeitar que existiu uma intenção de proteger o "clube que nunca caiu" no ano da morte do rei, e que ajudou outros times grandes a escapar do Z4.
Aquele pênalti do Goiás foi dentro da área e houve um chute forte no tornozelo sim, mas repito, pode ser duvidoso, aquele do Santos não tem dúvida nenhuma, com agravante que o VAR ainda foi chamado.
